    false,nt"url": null,nt"notes": "NCEI Accession 0128347 contains raw underway
    meteorological, navigational, optical, physical and time series data logged by the
    Scientific Computer System (SCS) aboard NOAA Ship Gordon Gunter in the Gulf of Mexico
    and North Atlantic Ocean from 2015-04-14 to 2015-06-13. Office of Marine and Aviation
    Operations (OMAO) personnel aboard the ship submitted these data and associated
    metadata to NCEI. In addition, NCEI Accession 0128347 contains supplementary cruise-level
    metadata, which OMAO personnel logged in the Ship Daily Activity Log (SDAL). OMAO
    and NCEI personnel developed the automated process to archive these data under the
